import React from 'react'
import Container from 'react-bootstrap/Container';
import styled from 'styled-components';
import Typography from '@mui/material/Typography';
import leftbg from "../assets/images/left-bg.png";

const Team = () => {
  const Teamwrapper = styled.div`
    position: relative;
    background-color: white;
    background-image: url(${leftbg});
    background-size: auto;
    background-repeat: no-repeat;
    background-position: top left;
  h3{
     color:${({theme})=>theme.colors.headeractive};
     font-family:inherit;
     margin-bottom:20px;
     margin-top:0px!important;
   }
   span{
        color:${({theme})=>theme.colors.text7};
        position: relative;
        font-size:14px;
  }
  
  const teamlist = [
    {
      name:'anil',
      middleName:"ramesh",
      surname:'kapse'
    }
  ]
  
  `
  return (
    <Teamwrapper>
      <Container className='announcementwrapper common_margin'>
        <Typography variant="h3" className='mt-3'>Teams</Typography>
        <span>below are the Team members list</span>
      </Container>
    </Teamwrapper>
  )
}

export default Team
